import React from 'react';
import '../App.css';
import logo from './public/logo.png';

function Tweet({name,message}){

    return(

        <div className="tweet">
             <h3> {name}  </h3>
             <img className="img" src={logo} alt="" />;
            <p> {message} </p>
             <a href="some link">Join the Room!</a>  
        </div>
        );
    }

    export default Tweet;
